            {title: "Ex5"},
            {title: "Ex6"}
    ]}

  render() {

    function Test(props) {
        if(this.props.cd==1){
            return {bac};
        }
        if(this.props.cd==2){
            return {trc};
        }
       
      }



        const bac = this.state.item.map( (it) => {
            return(
                <li>
                <a href="#">{it.title}</a>
              </li>

            );
        }
        )


        const trc = this.state.item2.map( (it) => {
            return(
                <li>
                <a href="#">{it.title}</a>
              </li>

            );
        }
        )


    return (
      <div>
        <div class="list-type5 mt-5">
          <ol>
            
            {Test()}
            
          </ol>
        </div>
      </div>
    );
  }

 

}

export default Acceuil;
